import ListAndPropsProvider from "./ListAndPropsProvider"

export default function ListAndProps() {
    const cars = ['Ford','BMW','Volvo']
    return(
        <>
        <h1>Who lives in my garage?</h1>
        {cars.map((car) => <ListAndPropsProvider brand={car.brand} />)}
        </>
    )
}
